import React from 'react'

import {
  Text,
  StyleSheet,
} from 'react-native';

const styles = StyleSheet.create({
  container: {
    flex: 1,
    // justifyContent: 'center',
    backgroundColor: 'lightblue', // '#ecf0f1',
    padding: 8,
    paddingTop: 50,
  },
  heading: {
    margin: 24,
    fontSize: 22,
    fontWeight: 'bold',
    textAlign: 'center',
  },
});

const Heading = () => {
  return (
    <Text style={styles.heading}>
        Tandem Trivia Game
      </Text>
  )
}

export default Heading;
